        "import matplotlib.pyplot as plt\n",
        "import seaborn as sns\n",
        "data = [12,34,21,31,23,35,25,51,55]\n",
        "fig, axes = plt.subplots(1, 2, figsize=(10, 4))\n",
        "sns.histplot(data, bins=5, ax=axes[0], color='skyblue')\n",
        "axes[0].set_title(\"Histogram\")\n",
        "sns.kdeplot(data, ax=axes[1], color='green', fill=True)\n",
        "axes[1].set_title(\"KDE Plot\")\n",
        "\n",
        "plt.tight_layout()\n",
        "plt.show()\n"
